import React, { useState } from "react";
import styled from "styled-components";

const firstWrapper = styled.div`
  width: 100%;
`;

const App = () => {
  return (
    <>
      <div
        style={{ width: "100%", height: "100vh", backgroundColor: "yellow" }}
      ></div>
    </>
  );
};

export default App;
